// import { createApp } from 'vue'
// import App from './App.vue'

// createApp(App).mount('#app')



import Vue from 'vue'
import App from './App'


export const eventBus = new Vue()
Vue.config.productionTip = false

/* eslint-disable no-new */
new Vue({
  el: '#app',

  components: { App },
  template: '<App/>'
})
